import React from "react";
import car from "../src/assets/car 1.png";
import charkhaqab from './assets/charkh aqab.png';

const App = () => {
    return(
    <div>

    <div class="night">
        <div class="surface"></div>
        <div class="car">
            <img src= {car} alt="car"/>
        </div>
        <div class="charkh1">
            <img src={charkhaqab} alt="charkh aqab"/>
        </div>
        <div class="charkh2">
            <img src="../src/assets/charkh jolo.png" alt="charkh jolo"/>
        </div>
    </div>

    </div>
    )

}

export default App;
